import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">

      <div className = "app_header">
        <img
          className = "app_headerImage"
          src = "https://www.google.com/url?sa=i&url=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FInstagram&psig=AOvVaw1OggUqTRkEKpZH0PU4gbNA&ust=1597255814556000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJDhm93fk-sCFQAAAAAdAAAAABAD"
          alt = "Instagram Header Logo"
        />
      </div>
      {/* Header */}

      {/* Posts */}
      {/* Posts */}

    </div>
  );
}

export default App;
